import { createSchema, addTranslations, setLanguageByName } from 'react-hook-form-auto'

export const VigenciaModel = createSchema('VigenciaModel', {
    vigencia: {
        type: 'number',
        required: true,
        min: 2000,
        max: 2100,
        // type: 'string',
        // required: true,
        // minLength: 4,
        // maxLength: 4,
    },
    estado: {
        type: 'select',
        required: true,
        options: [
            { value: '1', label: 'Activo' },
            { value: '0', label: 'Inactivo' }
        ],
    }
})

setLanguageByName('es')
addTranslations({
    models: {
        VigenciaModel: {
            vigencia: 'Vigencia',
            estado: {
                _field: 'Estado',
                _default: "Seleccione",
            },
        },
    },
})
